import './App.css';
import Category1 from './Category1';
import Category2 from './Category2';
import Category3 from './Category3';
// colors 90A8ED FF90E8 FFC900 23A094 bg-[#E5FAFF]
function App() {
  return (
    <div className = 'grid grid-rows-5 w-screen h-screen bg-[#E5FAFF] body-font font-fleuron'>
      <div className=' row-span-1 text-9xl font-fleuron'>
        Cognitia 2k23 <br/>
        A tech and cultural fest
      </div>
      <div className=' row-span-1'></div>
      <div className=' row-span-3 flex space-x-10 bg-[#E5FAFF]  place-items-center w-screen h-full flex-nowrap overflow-scroll'>
        <Category1 />
        <Category2 />
        <Category3 />
      </div>
    </div>
  );
}

export default App;
